romo email banners.<br\\/>\\r\\nEvery banner must have destination URL specified - it is the URL where the visitor is redirected after click.\"],[\"Set up emails\",\"Nastavenie E-mailov\"],[\"GetStartedEmails\",\"Nemali by ste zabudn\\u00fa\\u0165 nastavi\\u0165 spr\\u00e1vnu E-mail funkcionalitu, ktor\\u00e1 zah\\u0155\\u0148a:<br\\/><br\\/><ul><li><strong>E-mailov\\u00fd \\u00fa\\u010det<\\/strong> - ur\\u010duje sp\\u00f4sob odosielania E-mailov. M\\u00f4\\u017eete pou\\u017ei\\u0165 PHP mail() funkciu alebo SMTP server.<\\/li><br\\/><li><strong>\\u0160abl\\u00f3ny E-mailov<\\/strong> - tieto \\u0161abl\\u00f3ny s\\u00fa pou\\u017eit\\u00e9 v E-mailoch, ktor\\u00e9 s\\u00fa automaticky odoslan\\u00e9 syst\\u00e9mom ako napr\\u00edklad E-mail po registr\\u00e1ci\\u00ed alebo ozn\\u00e1menie o uskuto\\u010dnenom predaji.<\\/li><br\\/><li><strong>Ozn\\u00e1menia na E-mail<\\/strong> - m\\u00f4\\u017eete si nastavi\\u0165, ak\\u00e9 typy ozn\\u00e1men\\u00ed chcete dost\\u00e1va\\u0165 na E-mail. Tieto ozn\\u00e1menia m\\u00f4\\u017eete nastavi\\u0165 zvl\\u00e1\\u0161\\u0165 pre obchodn\\u00edkov a aj zvl\\u00e1\\u0161\\u0165 pre partnerov<\\/li><br\\/><\\/ul>Pred t\\u00fdm ako spust\\u00edte v\\u00e1\\u0161 syst\\u00e9m do prev\\u00e1dzky sa uistite, \\u017ee odosielanie E-mailov funguje spr\\u00e1vne.\"],[\"Customize your affiliate signup form\",\"Prisp\\u00f4sobenie registra\\u010dn\\u00e9ho formul\\u00e1ru\"],[\"GetStartedSignupForm\",\"Check the standard signup form, and customize it if you want.<br\\/><br\\/>\\r\\nThe signup form comes with an information mini-site that contains information about the affiliate program, etc.<br\\/>You can use the mini-site, or delete it and use only signup form.\"],[\"Customize affiliate panel\",\"Prisp\\u00f4sobenie programu\"],[\"GetStartedAffPanel\",\"Partnersk\\u00fd program v Post Affiliate Pro je ve\\u013emi flexibiln\\u00fd. M\\u00f4\\u017eete si ur\\u010di\\u0165, ako bude va3e menu vyzera\\u0165 a tak isto aj \\u010do bude obsahova\\u0165. Do polo\\u017eiek m\\u00f4\\u017eete nap\\u00edsa\\u0165 svoj vlastn\\u00fd obsah alebo m\\u00f4\\u017eete pou\\u017ei\\u0165 odkazy na in\\u00e9 str\\u00e1nky.\"],[\"GetStartedIntegrate\",\"Integration is a way to connect the affiliate system to your current website, shopping cart or payment gateway in a way that affiliate system will be notified about referrals and purchases.<br\\/>\\r\\nWhen notified, affiliate system registers the sale, finds referring affiliate (if any) and creates appropriate commission for him.<br\\/><br\\/>\\r\\nIntegration usually means adding few lines of code into your pages, and it is described step-by-step  in the Integration guide for most common shopping carts and payment systems. \"],[\"Test everything\",\"Otestovanie syst\\u00e9mu\"],[\"GetStartedTest\",\"When you have configured your campaigns, defined correct commissions, and created some banners\\/links, you should test the system.<br\\/>\\r\\nThe best is to simulate the whole process from affiliate\\u2019s and your point of view:\\r\\n<ol>\\r\\n<li>Sign up as some testing affiliate \\u2013 after approval you should receive confirmation email with your password, and you should be able to log in to your affiliate panel<\\/li>\\r\\n<li>Log in to affiliates panel, get the code for banners\\/links and put them\\u00a0onto some testing page<\\/li> \\r\\n<li>Click on the banner and check that the click is registered<\\/li>\\r\\n<li>After the click, try to make test sale and check that sale commission was registered in affiliate system (only for per sale or per lead commissions)<\\/li>\\r\\n<\\/ol>\\r\\n\\r\\nIf you experience some problems in any of these steps, turn on <strong>Debug event logging<\\/strong> and look at <strong>Troubleshooting<\\/strong>\"],[\"Promote your affiliate program\",\"Propag\\u00e1cia partnersk\\u00e9ho programu\"],[\"GetStartedPromote\",\"After you have successfully tested integration of affiliate system with your website, everything is 